//Style
import './App.css'
//Components
import HomePage from './components/HomePage/HomePage'
import Header from './components/Header/Header'
import Lists from './components/Lists/Lists'
import { fetchLists } from './actions/actions'
import Login from './components/Login_SingOut/Login'
//Libraries
import { useState, useEffect } from 'react'
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom'
import { useDispatch } from 'react-redux'
import { useSelector } from 'react-redux'


const App = () => {
  const client_id = '534704394140-vgqdcmbmel4gn1bfa7g3hd6h70qm5c6m.apps.googleusercontent.com'
  const dispatch = useDispatch()
  const email = useSelector((state) => state.login)

  useEffect(() => {
    console.log("Hello useEffect App: Dispatching Lists")
    dispatch(fetchLists(email.profileObj.email))
  }, [dispatch])

  return (
    <Router>
      <Switch>
        <Route exact path='/'>
          <Redirect to='/login' />
        </Route>
        <Route path='/home'>
          <Header />
          <HomePage />
        </Route>
        <Route path='/User/Lists/listName' >
          <Header />
          <Lists />
        </Route>
        <Route path='/LogIn'>
          <Login client_id={client_id}/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
